import React from 'react'
import { useForm } from "react-hook-form";
const AddPaciente = () => {
  const { register, handleSubmit, watch, formState: { errors } } = useForm();
  const addPaciente=(data)=>console.log(data)



  return (
    <form onSubmit={handleSubmit(addPaciente)} className='flex flex-col bg-white w-auto p-4 '>
        <label className='mt-4 mb-1' htmlFor="Cedula">Cedula</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Cedudla" id="Cedula" pattern='[0-9]{10}' minLength={10} maxLength={10} placeholder='Cedula del Paciente'
        {...register('Cedula',{
          required:{
            value:true,
            message:"Numero de Cedula es Obbligatrio"
          }
        })} />  
        {errors.Cedula && <span>{errors.Cedula.message}</span> }
        <label className='mt-4 mb-1' htmlFor="Nombre">Nombre</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Nombre" id="Nombre"  placeholder='Nombre del Paciente'
        {...register('Nombre',{
          required:{
            value:true,
            message:'Nombre es Obligatorio',
          },
          minLength:{value:1,message:"Nombre de tener almenos una Caracter"},
          maxLength:{value:90,message:"Nombre muy largo, maximo 90 caracteres"}
        })}
        />
        {errors.Nombre &&<span>{errors.Nombre.message}</span>}
        <input className='m-auto w-2/3 my-6' type="submit" value="Agregar" />
    </form>
  )
}

export default AddPaciente
